import React from "react";
import Cards from "../Cards";
import {
  WorkBg,
  WorkH1,
  WorkContainer,
  WorkContent,
  WorkFrost,
  AboutFrost2,
} from "./WorkElms";

const Work = () => {
  return (
    <WorkContainer id="work">
      <WorkFrost />
      <AboutFrost2 />
      <WorkBg>
        <WorkContent>
          <WorkH1></WorkH1>
          <Cards />
        </WorkContent>
      </WorkBg>
    </WorkContainer>
  );
};
export default Work;
